Решение практических задач в трех направлениях:
• Оптимизация бизнес-процессов - Все работает как часы и без потерь;
• Организационное развитие - Орг. структура решает задачи бизнеса;
• Управленческий учет, Бюджетирование, Информатика - Управление опирается на факты и показатели, а не на домыслы и суждения.
